MDBDropdownToggle, MDBDropdownMenu, MDBDropdownItem, MDBIcon } from "mdbreact";
import { BrowserRouter as Router } from 'react-router-dom';

class Header extends React.Component<any, any> {
	logOut(){
		sessionStorage.clear();	
	}
	state = {
		isOpen: false
	  };
	  
